import React from 'react';
import { Utils } from 'utils';
import {
  Button,
  Icon,
  Link,
  PlusGrid,
  PlusGridItem,
  Socials,
} from 'components';
import * as Constants from '../../../constants';
import { HeaderProps } from './header.types';
import styles from './header.module.scss';

export const Header: React.FC<HeaderProps> = ({ onMenuClick }) => {
  const classes = Utils.classes({
    [styles.root]: true,
  });

  return (
    <div className={classes}>
      <PlusGrid alignItems="center" gutter-x="md" wrap="off">
        <PlusGridItem xs="auto" hideLgUp>
          <button onClick={() => onMenuClick()}>menu</button>
        </PlusGridItem>
        <PlusGridItem>
          <Link to="ROUTE:HOME">
            <img src="/assets/logo/logo.svg" width="135px" />
            {/*{Constants.PLATFORM_NAME}*/}
          </Link>
        </PlusGridItem>
        <PlusGridItem xs="grow" />
        <PlusGridItem>
          <Button size="xs">Docs</Button>
        </PlusGridItem>
        <PlusGridItem>
          <Button size="xs">Pricing</Button>
        </PlusGridItem>
        <PlusGridItem>
          <Button size="xs">
            <Link to="ROUTE:COMPONENT:DETAILS" params={{ key: 'switch' }}>
              Components
            </Link>
          </Button>
        </PlusGridItem>
        <PlusGridItem>
          <Button size="xs">Version 1.2.7 (current)</Button>
        </PlusGridItem>
        <Socials />
      </PlusGrid>
    </div>
  );
};
